Taken 3 (2014) 
PG-13 | 109 min | Action, Thriller | 9 January 2015 (USA)

Liam Neeson returns as ex-covert operative Bryan Mills, whose long awaited reconciliation with his ex-wife is tragically cut short when she is brutally murdered. Consumed with rage, and framed for the crime, he goes on the run to evade the relentless pursuit of the CIA, FBI and the police. For one last time, Mills must use his &quot;particular set of skills,&quot; to track down the real killers, exact his unique brand of justice, and protect the only thing that matters to him now - his daughter.

Stars: Liam Neeson, Forest Whitaker, Maggie Grace


